//maxlenght of subarray with atmost 2types of fruits;
#include<bits/stdc++.h>
using namespace std;
class Solution{
    public:
    int totalfruits(vector<int>&arr){
    int maxi = 0; int n = arr.size();
    for(int i = 0; i<arr.size(); i++){
        set<int>st;
        for(int j = i; j<arr.size(); j++){
            st.insert(arr[j]);
            if(st.size() <= 2){
                int len = j - i + 1;
                maxi = max(maxi, len);
            }
            else{
                break;
            }
        }
    }
    return maxi;
    }
};
